import React, { Component } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { connect, Provider } from 'react-redux';

import { AuthNavigation, HomeNavigator, LoadingNavigator } from './src/navigation/index';
import AuthStore from './src/redux/store/AuthStore';
import reducer from './src/redux/reducers/index'

const store = AuthStore(reducer, 'test')

const Stack = createStackNavigator();
export default class App extends Component{

  render(){
    return(
    <Provider store={store}>
      <NavigationContainer>
        <Stack.Navigator             
          screenOptions={{
            headerShown: false,
          }}
          mode="modal"
          >
            <Stack.Screen name="Auth" component={AuthNavigation}/>
            <Stack.Screen name="Home" component={HomeNavigator}/>
            <Stack.Screen name="Loading" component={LoadingNavigator}
            options={{ 
              headerShown: false,
              cardStyle: { backgroundColor: 'transparent' },
              cardStyleInterpolator: ({ current: { progress } }) => ({
                  cardStyle: {
                  opacity: progress.interpolate({
                      inputRange: [0, 0.5, 0.9, 1],
                      outputRange: [0, 0.25, 0.7, 1],
                  }),
                  },
                  overlayStyle: {
                  opacity: progress.interpolate({
                      inputRange: [0, 1],
                      outputRange: [0, 0],
                      extrapolate: 'identity',
                  }),
                  },
              }),
          }}/>
          </Stack.Navigator>
      </NavigationContainer>
    </Provider>
  )
  }
}
